import React from "react";
import { FaSignOutAlt } from "react-icons/fa";
import "./Footer.css";

const handleSingOut = () => {
  console.log("OUT DOG");
};

const Admin = () => {
  return (
    <div>
      <footer className="footer">
        <span>
          <FaSignOutAlt
            style={{ color: "red" }}
            size={50}
            onClick={handleSingOut}
          />
        </span>
      </footer>
    </div>
  );
};

export default Admin;
